import React, { useContext }  from 'react'
import ShopContext from "../context/ShopContext";

function Shop() {
  const { allAnimalsData } = useContext(ShopContext);;
  return (
    <div>
      {allAnimalsData.map((item,i)=>{
        return(
          <Item
          key={i}
          id={item.id}
          image={item.image}
          breed={item.breed}
          price={item.price}
          gender={item.gender}
        />
        )
      })}
    </div>
  )
}

export default Shop
